) ENGINE=InnoDB AUTO_INCREMENT=1703 DEFAULT CHARSET=utf8 COMMENT='Maintains the many to many relationship between genotype and specimen. In situations such as with horticulture it may be necessary to define the specimen (individual plant) using many genotypes (hybrid or chimera plants, e.g. trees which have a different root stock and scion).  Enables the definition of more common cases where multiple specimens from a genotype (e.g. individuals grown in different environments) need to be distinguished.  Type can be added, but is not mandatory.';
