-- Table structure for table `trialunit`
--

DROP TABLE IF EXISTS `trialunit`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `trialunit` (
  `TrialUnitId` int(11) NOT NULL AUTO_INCREMENT COMMENT 'trial unit id',
  `TrialId` int(11) NOT NULL COMMENT 'trial id',
  `SourceTrialUnitId` int(11) DEFAULT 0 COMMENT 'Source Trial Unit that identifies the source of the sample used in the Trial Unit of the Trial. For example, the source trial unit for a wheat grain sample used in a milling trial can be a trial unit of a Wheat Variety Evaluation Trial. While importing data, the source file must provide information of one of the Alternate Key of Trial and the Unit Position of the source trial to identify the source trial unit.',
  `ReplicateNumber` int(10) NOT NULL COMMENT 'replicate number - next instance of the same specimen',
  `TrialUnitBarcode` varchar(254) DEFAULT NULL COMMENT 'barcode of the trial unit (plot)',
  `TrialUnitPosition` varchar(254) DEFAULT NULL COMMENT 'string describing the unit position e.g. can be concatenated list of dimensions',
  `TrialUnitEntryId` int(11) DEFAULT NULL COMMENT 'the same as unit position, but just a numeric value - useful if wanting to order units in numeric fashion',
  `TrialUnitX` int(11) DEFAULT NULL COMMENT 'X dimension of the trial unit (can be e.g. row)',
  `TrialUnitY` int(11) DEFAULT NULL COMMENT 'Y dimension of the trial unit (can be e.g. column)',
  `TrialUnitZ` int(11) DEFAULT NULL COMMENT 'Z dimension of the trial unit (can be e.g. block)',
  `TrialUnitNote` varchar(254) DEFAULT NULL COMMENT 'additional description for the trial unit',
  `SampleSupplierId` int(10) DEFAULT NULL COMMENT 'sample supplier id (contact or organisation, no defined relation here). Optional field to define who supplied the the seed. Choosing if this is contact or organisation is a matter for organisations convention.',
  `TrialUnitTypeId` int(11) DEFAULT NULL COMMENT 'type of trial unit',
  PRIMARY KEY (`TrialUnitId`),
  UNIQUE KEY `xtu_TrialUnitBarcode` (`TrialUnitBarcode`),
  KEY `xtu_TrialUnitPosition` (`TrialUnitPosition`),
  KEY `xtu_SampleSupplierId` (`SampleSupplierId`),
  KEY `xtu_SourceTrialUnitId` (`SourceTrialUnitId`),
  KEY `xtu_TrialId` (`TrialId`),
  KEY `xtu_TrialUnitEntryId` (`TrialUnitEntryId`),
  KEY `xtu_TrialUnitX` (`TrialUnitX`),
  KEY `xtu_TrialUnitY` (`TrialUnitY`),
  KEY `xtu_TrialUnitZ` (`TrialUnitZ`),
  KEY `trialunit_fk_2` (`TrialUnitTypeId`),
  CONSTRAINT `trialunit_fk` FOREIGN KEY (`TrialId`) REFERENCES `trial` (`TrialId`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `trialunit_fk_1` FOREIGN KEY (`SourceTrialUnitId`) REFERENCES `trialunit` (`TrialUnitId`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `trialunit_fk_2` FOREIGN KEY (`TrialUnitTypeId`) REFERENCES `generaltype` (`TypeId`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=3991 DEFAULT CHARSET=utf8 COMMENT='This table stores information about each unit of the trial. It assumes that the unit is homogeneous.  One trial unit can contain more than one specimen (e.g. for hybrid plants or when one plant died and another was replanted in place).  Trial unit is a measured unit, which can be further divided by sample types distinguished within.';
/*!40101 SET character_set_client = @saved_cs_client */;

